window.bookSummaryJSON = "<p><i>You have been chosen.</i></p> <p>Those four words change Violet Spencer’s whole life, when against staggering odds, she's selected in the \"princess ballot\".</p> <p>Arbon Academy is affectionately known as the school for Royals. Only the rich, powerful, or heir to a throne gain entry...except for the one scholarship student accepted every five years. It's a worldwide lottery, and one that Violet entered without giving it any serious thought.</p> <p>But the media got it wrong, and Arbon Academy is much more than a simple college for future leaders.</p> <p>It’s a dark world of politics, intrigue, and dangerous guys who will stop at nothing to get their own way. Despite her best efforts at remaining off the radar, Violet finds herself a pawn between two of the most powerful monarchies in the world.</p> <p>Prince Rafe of the Switzerlands and Prince Alex of the Australasias are bitter enemies both on the soccer field and in the political arena. Monarchies rule the world now, and every waking breath is a competition for the princes.</p> <p>Control the ball.</p> <p>Control the world.</p> <p>Control Violet.</p> <p>Whether it's through love or hate, someone will ultimately win.</p> <p><b>This is book one in a dark college romance. It includes a-hole princes, nasty princesses, and one chick who will take none of their sh!t, all the while doing her best to make it out alive. HEA guaranteed. Eventually. 17+.</b></p>"; 
